import React from "react";


export default function Photos(props) {
    console.log(props);
    if (props.photos) {
 return (
   <section className="Photos">
     <div className="row">
       {props.photos.map(function (photo, index) {
         return  <ing src={photo.src.landscape} key={index} />;
       })}
     </div>
   </section>
 ); 
} else {
    return null;
}
}
